import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import Artwork from "./pages/artwork";

function App() {
  return (
      <BrowserRouter>
        <div >
          <Route path="/artwork" component={Artwork} exact />
        </div>
      </BrowserRouter>
  );
}

export default App;
